🇪🇺💥🇷🇺 Presidente da Comissão Europeia Ursula von der Leyen: A União Europeia está propondo um novo pacote de "sanções mordazes" contra a Rússia

"A Rússia escalou a invasão da Ucrânia a um novo nível."

"E estamos determinados a fazer o Kremlin pagar o preço por essa nova escalada."

Principais declarações:

▪️ Proibir a importação de produtos russos no valor de 7 bilhões de euros;

▪️ Introduzir um teto para os preços do petróleo russo;

▪️ Impor sanções contra indivíduos que contornarão restrições contra a Rússia;

▪️ Expandir a lista de mercadorias proibidas para entrega à Federação Russa no campo da aviação e componentes eletrônicos, produtos químicos;

▪️ Proibir os cidadãos da UE de ingressarem nos órgãos de administração das empresas estatais russas.

